	/**
	 * 公积金异贷证明全国公积金中心查询
	 * @param req
	 * @param res
	 * @throws IOException
	 */
	@RequestMapping("/selfapi/loanFromDifferentPlaces/queryAllManagerCenter.do")
	public void queryAllManagerCenter(HttpServletRequest req,
			HttpServletResponse res) throws IOException {
		String provinceName = req.getParameter("provinceName");
		String cityName = req.getParameter("cityName");
		String centerName = req.getParameter("centerName");
		if(StringUtils.isNotEmpty(provinceName)){
			provinceName = URLDecoder.decode(provinceName, "utf-8");
		}
		if(StringUtils.isNotEmpty(cityName)){
			cityName = URLDecoder.decode(cityName, "utf-8");
		}
		if(StringUtils.isNotEmpty(centerName)){
			centerName = URLDecoder.decode(centerName, "utf-8");
		}
		
		Map<String, String> paramsMap = new HashMap<String, String>();
		paramsMap.put("dkdsf", provinceName);
		paramsMap.put("dkdcs", cityName);
		paramsMap.put("dkdzxmc", centerName);
		String sign = LoanFromDifferentPlacesUtil.signParams(paramsMap);
		
		String appName = "";
		if("test".equals(Config.get("reindeer.huidao.environment"))){
			appName = "c0137e68-8ef2-4898-821a-d4d932302fbf";
		} else if("product".equals(Config.get("reindeer.huidao.environment"))){
			appName = "fa3c7770-7a48-47a9-874f-935bd492f42b";
		}
		
        String signature = HttpUtil.getSignature(appName);
        JSONObject paramsJson = new JSONObject();
        paramsJson.put("dkdsf", provinceName == null ? "" : provinceName);
        paramsJson.put("dkdcs", cityName == null ? "" : cityName);
        paramsJson.put("dkdzxmc", centerName == null ? "" : centerName);
        paramsJson.put("sign", sign);
        
		String result = okHttp(appName, signature, paramsJson.toString());
		
		AciJsonHelper.writeJsonPResponse(req, res, result);
	}
	
