	/**
	 * 公积金异地贷款明细信息查询
	 * @param req
	 * @param res
	 * @throws IOException
	 */
	@RequestMapping("/selfapi/loanFromDifferentPlaces/queryCertificateDetail.do")
	public void queryCertificateDetail(HttpServletRequest req,
			HttpServletResponse res) throws IOException {
		String idCard = req.getParameter("idCard");
		String name = req.getParameter("name");
		String certNo = req.getParameter("certNo");
		/*
		 * 0、需要信息和文件
		 * 1、仅信息不需要文件
		 * 2、仅文件不需要信息
		 */
		String queryType = req.getParameter("queryType");
		if(StringUtils.isNotEmpty(name)){
			name = URLDecoder.decode(name, "utf-8");
		}
		if(StringUtils.isNotEmpty(certNo)){
			certNo = URLDecoder.decode(certNo, "utf-8");
		}
		if(StringUtils.isEmpty(queryType)){
			queryType = queryType == null ? "0" : queryType;
		}
		
		Map<String, String> paramsMap = new HashMap<String, String>();
		paramsMap.put("zjhm", idCard);
		paramsMap.put("xingming", name);
		paramsMap.put("zmbh", certNo);
		paramsMap.put("cxlx", queryType);
		String sign = LoanFromDifferentPlacesUtil.signParams(paramsMap);
		
		String appName = "";
		if("test".equals(Config.get("reindeer.huidao.environment"))){
			appName = "65e3417b-0c4e-4de3-9f4c-986e493ab797";
		} else if("product".equals(Config.get("reindeer.huidao.environment"))){
			appName = "ac88101d-62f5-4eaa-9473-573f53afb68c";
		}
		
        String signature = HttpUtil.getSignature(appName);
        JSONObject paramsJson = new JSONObject();
        paramsJson.put("zjhm", idCard);
        paramsJson.put("xingming", name);
        paramsJson.put("zmbh", certNo);
        paramsJson.put("cxlx", queryType);
        paramsJson.put("sign", sign);
		String result = okHttp(appName, signature, paramsJson.toString());
		if("2".equals(queryType)){
			try{
				JSONObject resultJson = JSONObject.fromObject(result);
				String code = resultJson.optString("code");
				if("0".equals(code)){
					JSONObject data = resultJson.optJSONObject("data");
					String fileInfo = data.optString("fileInfo");
					result = fileInfo.replaceAll("\\n", "");
					byte[] bytes = new BASE64Decoder().decodeBuffer(fileInfo);
					if(bytes != null ){
						OutputStream out = res.getOutputStream();
						res.setContentType("application/pdf");
						out.write(bytes);
						out.close();
					}
				}
			} catch (Exception e) {
				Log.debug(e.getMessage().toString());
			}
		} else {
			AciJsonHelper.writeJsonPResponse(req, res, result);
		}
	}
	
	private static String okHttp(String appName, String signature, String params){
		String str = "";
		String url = RdConfig.get("reindeer.huidao.url."+RdConfig.get("reindeer.huidao.environment"));		
		OkHttpClient client = null;
		if(url.startsWith("https://")){
			client= HttpUtil.getUnsafeOkHttpClient();
		} else {
			client = new OkHttpClient();
		}
		
		MediaType mediaType=MediaType.parse("application/json");
		RequestBody body=RequestBody.create(mediaType, params);
		Request request = new Request.Builder()
		.url(url)
		.header("signature", signature)
		.header("apiname", appName)
		.header("appid", RdConfig.get("reindeer.huidao.appId."+RdConfig.get("reindeer.huidao.environment")))
		.post(body)
		.build();
		
		Call call = client.newCall(request);
		Response response = null;
		try {
			response = call.execute();
			byte[] responseByt = response.body().bytes();
			str = new String(responseByt, "utf-8");
			System.out.println(str);
		} catch (IOException e) {
			Log.debug(e);
			Log.debug("访问失败");
		} finally {
			if(response != null){
				response.body().close();
			}
		}
		return str;
	}
	
